import React , {Component} from "react";
class App extends Component{
    constructor(){
        super()
        this.state={
            a:[],b:[],operator:"none",displayValue:"0"
        }
        this.handleOperator=this.handleOperator.bind(this)
        this.handlenumber=this.handlenumber.bind(this)
        this.delete=this.delete.bind(this)
    }

    handlenumber=(nb)=>{
        if(this.state.operator==="none"){
            this.setState((prevState)=>({
                a:[...prevState.a,nb]
            }),()=>{console.log(this.state.a.join('')+"a")})
        }else{
            this.setState((prevState)=>({
                b:[...prevState.b,nb]
            }),()=>console.log(this.state.b+"b"))
        }

        this.display()
    }
    handleOperator(op){
        this.setState({operator:op},()=>{console.log(this.state.operator)})
        this.display()

    }

    delete(){

    }
    calculate(event) {

    }

    display(){
        let text= this.state.a.join('').toString() + this.operator + this.state.b.join('').toString()
        this.setState({display:text})
        console.log(this.state.display)
    }

    render(){
        const buttonStyle={
            width:"50px",
            height:"50px"
        }
        return(
            <div>
                <input 
                        type="text" 
                       style={{height:"50px",width:"200px"}} 
                       value={this.state.displayValue} 
                >
                </input>
                <br/>

               <div>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(1)}> 1 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(2)}> 2 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(3)}> 3 </button>
               </div>
               <div>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(4)}> 4 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(5)}> 5 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(6)}> 6 </button>
               </div>
               <div>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(7)}> 7 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(8)}> 8 </button>
                    <button style={buttonStyle} onClick={()=>this.handlenumber(9)}> 9 </button>
               </div>

               <br/>
               <button style={buttonStyle} onClick={()=>this.handleOperator("+")} > + </button> 
               <button style={buttonStyle} onClick={()=>this.handleOperator("-")} > - </button> 
               <button style={buttonStyle} onClick={()=>this.handleOperator("*")} > * </button> 
               <button style={buttonStyle} onClick={()=>this.handleOperator("/")} > / </button> 
               <br/>
               <button style={{width:"70px", height:"40px"}} onClick={this.delete} > del </button>
               <button style={{width:"130px", height:"40px"}} onClick={this.calculate} > = </button>
            </div>
        )
    }
}
export default App
